import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Robert</h1>
      <Todolist/>
    </div>
  );
}

const Todolist = ()=>{
  return (
    <div>
      <h3>
        What to learn
      </h3>
      <div>
        <input/>
        <button>+</button>
      </div>
      <ul>
        <li>
          <input type='checkbox' checked={true}/>
          <span>CSS & HTML</span>
        </li>
        <li>
          <input type='checkbox' checked={true}/>
          <span>JS</span>
        </li>
        <li>
          <input type='checkbox' checked={false}/>
          <span>React</span>
        </li>
      </ul>
    </div>
  )
}

export default App;
